@regran_ed from @impeachtrump2019 -  there is absolutely no point in an investigation where the scope is controlled by and limited by trump or white house counsel, john mcgann. such an investigation would be as much of a useless farce as the judiciary hearing was in proving or disproving allegations of sexual assault against brett kavanagh. you cannot minimize the need for a sincere and thorough investigation, and think you're going to placate the american people, by having the fbi take a cursory glance at these allegations. i say to @jeffflake, if you were serious in your decision not to vote for kavanagh unless there is an investigation, make sure it's an actual full-throated investigation. @senatorchriscoons please stay on top of this.
